import './App.css';
import {Routes,Route} from "react-router-dom"
import MainPage from './component/MainPage';
import HomePage from "./component/HomePage"
function App() {
  return (
    <div className="App">

  <Routes>

    <Route exact path='/' element={<MainPage/>} />
    <Route exact path='/homepage' element={<HomePage/>} />

     </Routes>


       <MainPage></MainPage>  
    </div>
  );
}

export default App;
